 import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpense/NewExpense"; 

const App = () => {
  const expences = [
    {
      id: 'e1',
      title: "Car Insurance",
      amount: "10000",
      date: new Date(2021, 12, 28),
    },
    {
      id: 'e2',
      title: "Toilet Paper",
      amount: "10000",
      date: new Date(2021, 2, 8),
    },
    {
      id: 'e3',
      title: "New TV",
      amount: "10000",
      date: new Date(), //Gives current date
    },
    {
      id: 'e4',
      title: "Car Insurance",
      amount: "10000",
      date: new Date(2021, 5, 2),
    },
  ];
  return (
    <div>
            <NewExpense />
      <Expenses items={expences} />
    </div>
  );
}

export default App;
